import {Button, Drawer, Menu} from 'antd';
import { useState } from 'react';
import { MenuOutlined } from '@ant-design/icons';

const Navbar = ({ onLoginClick }) =>{
    const [openMenu, setOpenMenu] = useState(false);

    return(
        <div style={{ height: "100vh" }}>
        <div className='menuIcon'
        style={{ height: 25, backgroundColor: 'white'}}>
            <MenuOutlined 
            style={{ color: "black", fontSize: 16 }}
            onClick={()=>{
                setOpenMenu(true);}}
            />
        </div>
            <span className='headerMenu'>
                <AppMenu onLoginClick={onLoginClick} />
            </span>    
            <Drawer 
            placement='left'
            open={openMenu} 
            closable={false}
            onClose={()=>{
                setOpenMenu(false);
            }}>
                <AppMenu isInline />
        </Drawer>
        </div>
    );
};

export default Navbar;

function Logo() {
    return (
      <div style={{ display: 'flex', alignItems: 'center', color: 'white', fontSize: '20px' }}>
        <img src="./Components/images/Logo.png" alt="logo" />

      </div>
    );
  };

function AppMenu({isInline=false}){

    return(
        <Menu 
            style={{ height: '80px', paddingInline: 50, lineHeight: '64px', top: 50, border: 'none'}}
            mode={ isInline? "inline" :'horizontal'} 
            items={[
                {
                    label: <Logo/>,
                    key: "logo", 
                },
                {
                    label: 'Home',
                    key:'home',
                },{
                    label: 'About us',
                    key:'about',
                }, {
                    label: <Button > Login </Button>,
                    key:'login',
                }

            ]}
            >
            </Menu>
    );
}
